    false,nt"url": null,nt"notes": "Ecological Specialists, Inc. was contracted
    by the City of New Martinsville, West Virginia, to survey the Ohio River unionid
    molluscs downstream of the Willow Island Locks & Dam. The survey was conducted November
    6 through November 11, 1990. The area was sampled by brail at half mile intervals.
    Brailing results indicated few unionids occupy the area from Willow Island to Marietta,
    Ohio River miles 162.5 to 172.5. Substrate samples consisted of silty sand and cobble,
    which may have precluded the occurrence of unionids.",nt"license_title": "License
